column8:
●女性用フィットネスゴーグル。快適なスイミングのための機能とデザインを兼ね備えた女性用モデル。肌に直接触れるベルト・クッションには柔らかくてお肌に優しいシリコーン素材を使用しています。ゴーグルサイドには女性らしさを演出するデコシール。<br>●素材：アイカップ/ポリカーボネート クッション/シリコーンゴム ベルトアジャスター/ポリカーボネート 鼻ベルト/エラストマー ベルト/シリコーンゴム<br><br>※画像のカラーは、撮影時の照明等の具合により実物と異なる可能性がございます。<br>
