★スピードのゴーグル！<br>
<br>
●IQフィットテクノロジーが生んだ究極のフィットネスモデル。<br>
●大きめのカップが広視野を確保し、くもり止め効果も従来品と比較し2倍長持ち！<br>
●IQfitを搭載した3Dアイパッドはしっかりフィットし水の浸入を防ぎ、目の周りに跡が付きにくい仕様。<br>
●男女兼用のミラータイプ。<br>
●ゴーグルを守る保護ケースが付属しています。<br>
<br>
■素材<br>
レンズ、フレーム：ポリカーボネイト<br>
フェイスパッド：サーモプラスチックラバー<br>
ストラップ：シリコーン<br>
■企画製造販売元 株式会社ゴールドウイン<br>
