<br>
●レンズとストラップが"曲がる"ように顔の形状にフィットし、水の浸入を防止。<br>
低抵抗感に加えてクッション付きのフィット感をゴーグルに求める方にオススメの一品！<br>
●レンズは抵抗を軽減させるミニマムレンズを採用。<br>
●環境に配慮した「再生できる紙パッケージ」を採用。ゴーグルポーチ付き！<br>
●UVカット・曇り止め機能！<br>
