★スピードのFINA承認競泳ゴーグル！<br>
<br>
●IQフィットテクノロジーが生んだ究極のトップコンペモデル！<br>
●頭と顔の形にフィットするような3Dフェイスパッドで、圧迫感を軽減。<br>
●レンズはミラータイプで、180度まで視界が広がり、また特殊な曇り止め加工も施されています。<br>
●UVカット加工で屋外での使用も安心！<br>
●ゴーグルストラップは完全一体型なのでストラップの端がジャマになりません。<br>
●ストラップはテンションスケール付きなので自分の好みのキツさに簡単に調節が可能。<br>
●持ち運びに嬉しいポーチ付き。<br>
<br>
■素材<br>
レンズ、フレーム：ポリカーボネイト<br>
フェイス：サーモプラスチックラバー<br>
ストラップ：シリコーン<br>
